d dreams within us all. This is the quidam whom this show allows to speak. This is the place that beckonsa place for dreaming and genuine relations where all quidams, by proclaiming their individuality, can finally emerge from anonymity. ','Young Zo is bored; her parents, distant and apathetic, ignore her. Her life has lost all meaning. Seeking to fill the void of her existence, she slides into an imaginary worldthe world of Quidamwhere she meets characters who encourage her to free her soul.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'0','0','0','2016-03-26 00:00:00','Yes','Yes','No','No','No','No',NULL,NULL,NULL,NULL,'0','No','active','2011-02-05 12:43:53','2011-02-05 12:59:40','Coley, R.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'525 West Santa Clara Street','San Jose','CA','95113','','HP Pavilion, San Jose, CA',5,-8,-8,NULL,'No','n10n4-Q9Q9V$03-k2k3D','http://KITSweb.rbca.net','989898$06','http://KITSweb.rbca.net'),(199,'pa100369','Mikeyla\'s 2nd Birthday Celebration','Mikeyla\'s 2nd Birthday Celebration','party','2011-03-13 00:00:00','2011-03-13 00:00:00','1899-12-30 12:00:00','1899-12-30 14:00:00',NULL,NULL,NULL,NULL,NULL,0,0,'635 Lanfair Ct., San Jose, CA 95136','2011-02-05 00:00:00','html',NULL,NULL,'Robert & Alyssa','A family celebration of Mikeyla\'s 2nd Birthday.','A family celebration of Mikeyla\'s 2nd Birthday.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'0','0','0','2016-03-13 00:00:00','Yes','No','No','No','No','No',NULL,NULL,NULL,NULL,'0','No','active','2011-02-05 12:52:30','2011-03-12 08:44:31','Coley, R.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'635 Lanfair Court','San Jose','CA','95136','','Alyssa & Robert\'s Home, San Jose, CA',5,-8,-8,NULL,'No','n10n4-Q9Q9V$03-k2k3D','http://KITSweb.rbca.net','989898$06','http://KITSweb.rbca.net'),(200,'ap100370','Babysitting Mikeyla','Babysitting Mikeyla','appt','2011-02-11 00:00:00','2011-02-11 00:00:00','1899-12-30 18:30:00','1899-12-30 21:30:00',NULL,NULL,NULL,NULL,NULL,0,0,'635 Lanfair Court\r